import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';
import './Header.css';

const Header = () => (
  <AppBar position="static" elevation={2} className="custom-appbar">
    <Toolbar className="custom-toolbar">
      <Box sx={{ display: 'flex', alignItems: 'center', flexGrow: 1 }}>
        <img src={logo} alt="Logo" className="logo-img" />
        <Typography variant="h6" component="div" className="site-title">
          Iceberg Edutech
        </Typography>
      </Box>
      <Button color="inherit" component={Link} to="/" className="nav-btn">Home</Button>
      <Button color="inherit" component={Link} to="/courses" className="nav-btn">Courses</Button>
      <Button color="inherit" component={Link} to="/about" className="nav-btn">About</Button>
      <Button color="inherit" component={Link} to="/contact" className="nav-btn">Contact Us</Button>
    </Toolbar>
  </AppBar>
);

export default Header;
